const Navbar = () => {
    return (
        <nav>
            <ul>
                <li>All</li>
                <li>UI Design</li>
                <li>UX Design</li>
                <li>Product Design</li>
                <li>Articles</li>
                <li>Tutorials</li>
                <li>News</li>
            </ul>
        </nav>
    );
};
export default Navbar;
